import React, { Component } from 'react';
import Select from 'react-select';
import axios from 'axios';

const initialState = {
    triptype:'',
    duration:'',
     totalamount:'',
    vehicles:[],
    options:[],
    selectedvehicles:[]

}
class CreateTrip extends  Component{
    constructor(props){
        super(props);
        this.onChange = this.onChange.bind(this);
        this.onVehicleSelect =this.onVehicleSelect.bind(this);
        this.onSubmit =this.onSubmit.bind(this);
        this.state = initialState;
    }
    componentDidMount(){
        axios.get('http://localhost:8055/vehicle/')
        .then(response =>{
            this.setState({ vehicles: response.data.data}, () =>{
                // console.log('subjects',this.state.subjects)
                let data =[];
               this.state.vehicles.map((item, index) =>{
                   let vehicle = {
                       value: item._id,
                    //    label:item.name
                    label:item.type
                   }
                   data.push(vehicle)
               });
               this.setState({ options: data });
            })
        })
    }
    onChange(e){
        this.setState({[e.target.name]:e.target.value})
    }
    onVehicleSelect(e){
        this.setState({ selectedvehicles:e ?e.map(item => item.value): []});
    }
    onSubmit(e){
        e.preventDefault();
        let trip ={
            triptype:this.state.triptype,
            duration:this.state.duration,
            // totalamount:this.state.totalamount,
            vehicles:this.state.selectedvehicles
        };
        // console.log('DATA TO SEND',trip)
        axios.post('http://localhost:8055/trip/create', trip)
        .then(response => {
            alert("success!")
        })
        .catch(error =>{
            console.log(error.message);
            alert(error.message)
        })


    }
    render(){
        return(
            <div className= "container">
                <h1>Create trip</h1>
                <form onSubmit ={this.onSubmit}>
                    <div className="mb-3">
                        <label htmlFor="triptype" className="form-label">Trip type</label>
                        <input type="text" 
                        className="form-control"
                         id="triptype" 
                         name= "triptype" 
                         value = {this.state.triptype} 
                         onChange={this.onChange}
                         />
                    </div>
                    <div className="mb-3">
                        <label htmlFor="duration" className="form-label">Duration</label>
                        <input type="text" 
                        className="form-control"
                         id="duration" 
                         name= "duration" 
                         value = {this.state.duration} 
                         onChange={this.onChange}
                         />
                    </div>
                    {/* <div className="mb-3">
                        <label htmlFor="totalamount" className="form-label">Total amount</label>
                        <input type="text"
                         className="form-control" 
                         id="totalamount" 
                         name = "totalamount" 
                         value={this.state.totalamount}
                         onChange={this.onChange}
                          />
                    </div> */}
                    {/* <div className="mb-3">
                        <label htmlFor="name" className="form-label">Name</label>
                        <input type="text"
                         className="form-control" 
                         id="name" 
                         name = "name" 
                         value={this.state.name}
                         onChange={this.onChange}
                        
                          />
                    </div> */}
                    <Select
                        options = {this.state.options}
                        onChange={this.onVehicleSelect}
                        className="basic-multi-select"
                        isMulti
                    />


                    <button type="submit" className="btn btn-primary">Submit</button>
                </form>
            </div>
        )
    }
}
export default CreateTrip;
